ProductCategory.create!([
  {name: "Керамогранит", description: "<p>В ассортименте нашего магазина есть керамическая плитка, которую можно использовать для обустройства любого жилого помещения, плитка для ванной с влагоустойчивыми характеристиками, плитка напольная - имеет свойства износоустойчивости. Керамогранит, керамический гранит, это современный чрезвычайно прочный материал, который по своим характеристикам не уступает натуральному граниту. Клинкерная плитка, область применения клинкера многообразна и главным качеством и преимуществом является его морозоустойчивость и жароустойчивость одновременно. Мозаика - это прежде всего декоративный элемент в дизайне помещения, изготавливается мозаика из стекла, керамики, смальты, камня, золота, платины. Сантехника &ndash; это то, без чего не обходится ни одна ванная комната. У нас представлены - компакты, умывальники, душевые уголки, смесители, мебель для ванной комнаты и многое другое. Строительная химия - занимаясь плиткой нельзя забывать о сопутствующих товарах, таких как клей для плитки, затирка для плитки, герметик для плитки.<br />\r\nАссортимент магазина постоянно расширяется, если Вы не нашли необходимую продукцию, Вы можете задать вопрос нашим консультантам и они помогут Вам.<br />\r\nВ разделе Важно знать, для Вас собрана информация, которая пригодится при покупке плитки.&nbsp;<br />\r\nВ наших салонах, Вы можете ознакомиться с ассортиментом и получить консультацию.&nbsp;</p>\r\n", meta_title: "Керамогранит", meta_description: "", meta_keywords: "", product_category_id: 1, image_file_name: nil, image_content_type: nil, image_file_size: nil, image_updated_at: nil, avatar_file_name: "1.jpg", avatar_content_type: "image/jpeg", avatar_file_size: 32961, avatar_updated_at: "2015-05-17 02:27:38", big_image_file_name: "category_img_1.jpg", big_image_content_type: "image/jpeg", big_image_file_size: 51184, big_image_updated_at: "2015-05-16 05:02:10"},
